using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace AdventOfCode
{
    class Day5
    {

        public static void Part1()
        {
            int cambios = 1;
            while (cambios != 0)
            {
                cambios = 0;
                foreach (string s in chars.Select(c => $"{c}{(char)(c - 32)}"))
                {
                    int length = input.Length;
                    input = input.Replace(s, "");
                    input = input.Replace(new string(s.Reverse().ToArray()), "");
                    cambios += (input.Length != length) ? 1 : 0;
                }
            }
            Console.WriteLine($"{input} {input.Length}");
            Console.ReadKey();
        }

        public class Resultado
        {
            public char caracter { get; set; }
            public int longitud { get; set; }
        }
        public static void Part2()
        {
            Dictionary<char, int> values = new Dictionary<char, int>();
            foreach (char letter in chars)
            {
                string inputModified = input.Replace(letter.ToString(), "");
                inputModified = inputModified.Replace(char.ToUpper(letter).ToString(), "");
                int cambios = 1;

                while (cambios != 0)
                {
                    cambios = 0;
                    foreach (string s in chars.Select(c => $"{c}{(char)(c - 32)}"))
                    {
                        int length = inputModified.Length;
                        inputModified = inputModified.Replace(s, "");
                        inputModified = inputModified.Replace(new string(s.Reverse().ToArray()), "");
                        cambios += (inputModified.Length != length) ? 1 : 0;
                    }
                }
                values.Add(letter, inputModified.Length);



            }
            foreach (var kv in values.OrderBy(o => o.Value))
            {
                Console.WriteLine($"{kv.Key} {kv.Value}");
            }
            Console.ReadKey();
        }


        static string chars = "abcdefghijklmnopqrstuvwxyz";
        static string input = @"";
    }
}
